import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Todo App</h1>
      <div className="container">
        <div className="input-item">
          <label>Task title</label>
          <input type="text" /> 
          </div>
          <div className="input-item">
          <label>Task description</label>
          <input type="text" /> 
          </div>
          <div className="input-item">
          <label>Task description</label>
         <button type="button" className="primaryBtn"></button>
          </div>
      </div>
    </div>
  );
}

export default App;
